import React, { Component } from 'react'

export class Navbar extends Component {
    render() {
        return (
            <nav className='navbar bg-primary'>
                <h1>
                    <i className="fab fa-github"> GitHub Finder </i>
                    GitHub Finder</h1>
            </nav>
        )
    }
}

export default Navbar
